import axios from "axios";
import { VISUALIZZA_NOTIFICHE } from "./type";

export const ListaNotifiche = (cliente) => (dispatch) => {
  axios
    .put("/api/notifiche/notifichelist/", cliente)
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: VISUALIZZA_NOTIFICHE,
        payload: res.data,
      });
    })
    .catch((err) => console.error(err));
};

export const inviaNotificaCliente = (idnotifica, cliente) => (dispatch) => {
  axios
    .put(`/api/notifiche/inviaNotificaCliente/${idnotifica}`, cliente)
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: CANCELLA_NOTIFICA,
        payload: id,
      });
    })
    .catch((err) => console.error(err));
};
